import React from "react";

export const Reusable_table2 = ({ data, nameOfColumn }) => {
  return (
    <div>
      <table className=" table_of_reusable_table table table-striped table-responsive text-center table-hover table-bordered">
        <thead>
          <tr>
            {nameOfColumn}
            <th>a</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>b</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};
